/*Table structure for table `animal_report` */

DROP TABLE IF EXISTS `animal_report`;

/*!50001 DROP VIEW IF EXISTS `animal_report` */;
/*!50001 DROP TABLE IF EXISTS `animal_report` */;

/*!50001 CREATE TABLE  `animal_report`(
 `id` int(10) unsigned ,
 `code` varchar(20) ,
 `name` varchar(45) ,
 `birthdate` varchar(10) ,
 `prefix` varchar(20) ,
 `breeder` varchar(131) ,
 `owner` varchar(131) ,
 `mom_prefix` varchar(20) ,
 `mom_name` varchar(45) ,
 `dad_prefix` varchar(20) ,
 `dad_name` varchar(45) 
)*/;

/*Table structure for table `animal_report_short` */

DROP TABLE IF EXISTS `animal_report_short`;

/*!50001 DROP VIEW IF EXISTS `animal_report_short` */;
/*!50001 DROP TABLE IF EXISTS `animal_report_short` */;

/*!50001 CREATE TABLE  `animal_report_short`(
 `id` int(10) unsigned ,
 `name` varchar(45) ,
 `prefix` varchar(20) ,
 `names` varchar(50) ,
 `lastnames` varchar(80) 
)*/;

/*View structure for view animal_report */

/*!50001 DROP TABLE IF EXISTS `animal_report` */;
/*!50001 DROP VIEW IF EXISTS `animal_report` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `animal_report` AS select `a`.`id` AS `id`,`a`.`code` AS `code`,`a`.`name` AS `name`,date_format(`a`.`birthdate`,'%d-%m-%Y') AS `birthdate`,`c`.`prefix` AS `prefix`,concat(`c`.`names`,' ',`c`.`lastnames`) AS `breeder`,concat(`e`.`names`,' ',`e`.`lastnames`) AS `owner`,`mom`.`prefix` AS `mom_prefix`,`mom`.`name` AS `mom_name`,`dad`.`prefix` AS `dad_prefix`,`dad`.`name` AS `dad_name` from ((((((`animals` `a` left join `animal_agent` `b` on(((`b`.`animal_id` = `a`.`id`) and (`b`.`type` = 'breeder')))) left join `agents` `c` on((`c`.`id` = `b`.`agent_id`))) left join `animal_agent` `d` on(((`d`.`animal_id` = `a`.`id`) and (`d`.`type` = 'owner')))) left join `agents` `e` on((`e`.`id` = `d`.`agent_id`))) left join `animal_report_short` `mom` on((`mom`.`id` = `a`.`mom`))) left join `animal_report_short` `dad` on((`dad`.`id` = `a`.`dad`))) */;

/*View structure for view animal_report_short */

/*!50001 DROP TABLE IF EXISTS `animal_report_short` */;
/*!50001 DROP VIEW IF EXISTS `animal_report_short` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `animal_report_short` AS select `a`.`id` AS `id`,`a`.`name` AS `name`,`c`.`prefix` AS `prefix`,`c`.`names` AS `names`,`c`.`lastnames` AS `lastnames` from ((`animals` `a` left join `animal_agent` `b` on(((`b`.`animal_id` = `a`.`id`) and (`b`.`type` = 'breeder')))) left join `agents` `c` on((`c`.`id` = `b`.`agent_id`))) */;

